var myImage = new Image();
myImage.src = 'data:image/png;base64,';

myImage.addEventListener('load', function () {
    var canvas = document.getElementById('canvas1');
    var ctx = canvas.getContext('2d');
    canvas.width = 500;
    canvas.height = 280;

    ctx.drawImage(myImage, 0, 0, canvas.width, canvas.height);
    var pixels = ctx.getImageData(0, 0, canvas.width, canvas.height);

    var particlesArray = [];
    var numberOfParticles = 1000;

    var mappedImage = [];
    for (var y = 0; y < canvas.height; y++) {
        var row = [];
        for (var x = 0; x < canvas.width; x++) {
            var red = pixels.data[(y * 4 * pixels.width) + (x * 4)];
            var green = pixels.data[(y * 4 * pixels.width) + (x * 4 + 1)];
            var blue = pixels.data[(y * 4 * pixels.width) + (x * 4 + 2)];
            var brightness = calculateRelativeBrightness(red, green, blue);
            var cell = [
                cellBrightness = brightness,
            ];

            row.push(cell);
        }
        mappedImage.push(row);
    }

    function calculateRelativeBrightness(r, g, b) {
        res = Math.sqrt( (r * r) * 0.299 +  (g * g) * 0.587 +  (b * b) *0.114 )/100;

        return res;
    }

    class Particle {
        constructor() {
            this.x = Math.random() * canvas.width;
            this.y = 0;
            this.speed = 0;
            this.velocity = Math.random() * 3.5;
            this.size = Math.random() * 1.5 + 1;
            this.position1 = Math.floor(this.y);
            this.position2 = Math.floor(this.x);
        }

        update() {
            this.position1 = Math.floor(this.y);
            this.position2 = Math.floor(this.x);
            this.speed = mappedImage[this.position1][this.position2][0];
            var movement = (2.5 - this.speed) + this.velocity;

            this.y += movement;
            if (this.y >= canvas.height) {
                this.y = 0;
                this.x = Math.random() * canvas.width;
            }
        }

        draw() {
            ctx.beginPath();
            ctx.fillStyle = 'white';
            ctx.arc(this.x, this.y, this.size, 0, Math.PI * 2);
            ctx.fill();
        }
    }

    function init() {
        for (var i = 0; i < numberOfParticles; i++) {
            particlesArray.push(new Particle);
        }
    }

    init();

    function animate() {
        ctx.drawImage(myImage, 0, 0, canvas.width, canvas.height);
        ctx.globalAlpha = 0.05;
        ctx.fillStyle = 'rgba(0, 0, 0)';
        ctx.fillRect(0, 0, canvas.width, canvas.height);
        for (var i = 0; i < particlesArray.length; i++) {
            particlesArray[i].update();
            particlesArray[i].draw();
        }
        requestAnimationFrame(animate);
    }

    animate();
})